import {Panel} from "../index";
import {connect} from "react-redux";
import React, {Fragment} from "react";

const Panels = ({items}) =>
    (
        <Fragment>
            {items.map((item, index) => (
                <Panel key={index} {...item} />
            ))}
            <Panel key={index} {...item} />
        </Fragment>
    );

export default connect(({panels}) => ({items: panels}))(Panels);
